(27619, 83272, 2744, 9, 'Honey Bee', 'Genre: Funk\nLength: 0:57\nInstruments: EP, Bass, Percussion, Horns\nTempo: 100\n\nThe electric piano alternates between playing the rhythm and creating a sliding melody, while trumpets sound in the background, sometimes stealing the melody. The percussion makes for a toe-tapping good time. This is useful for the closing segment of a TV show, game, or transition. Cleanly loopable. 011 Bouncy, Bright 2010\n\nHoney Bee by Kevin MacLeod (http://incompetech.com/email.html) is licensed under a CC Attribution 3.0 (http://creativecommons.org/licenses/by/3.0/deed.zh_TW).\n\n你可自由：\n分享 — 重製、散布及傳輸本著作\n重混 — 修改本著作\n對本著作進行商業利用\n\n惟需遵照下列條件：\n姓名標示 — 你必須按照著作人或授權人所指定的方式，表彰其姓名（但不得以任何方式暗示其為你或你使用本著作的方式背書）。\n\n姓名標示範例：\nHoney Bee by Kevin MacLeod\n', '2010-09-08 00:00:00', 2010, 0, 1, 14, '', '', 57, '', '', '', '', '', '', 1, 1, 0, '2010-09-08 17:17:35', '2015-03-12 13:43:35', '0000-00-00 00:00:00'),
