(27633, 83259, 0, 1, 'I Wanna say nomore', '帶有BOSSA NOVA的前奏\r\n彷彿早上剛起床般的慵懶\r\n自己的人生 自己的故事 \r\n不管是一天 還是一輩子\r\n都需要好好的過與感受', '2010-09-09 00:00:00', 2000, 0, 1, 1, '今天你要問我笑什麼理由\r\n我卻懶洋洋的什麼也不說\r\n想要換個心情到街上走走\r\n人群中看不到真實的笑容\r\n \r\n 我站在馬路上 問誰有自由\r\n反覆的疑惑 怎麼說 怎麼做 都沒有人告訴我\r\n那就這樣吧 我照著感覺走\r\n自己的人生 就是要 自己走 就別再想太多\r\n \r\n 故事情節總是曲折又多愁\r\n是不是該做的 就別再想太多\r\n \r\n 我要的是從容不迫和滑稽的幽默\r\n別再跟我說一堆沒用的濫藉口\r\n想到的就要去做 別做白日夢\r\n別再囉唆 還想牽托\r\n\r\n I wanna say no more\r\n', '', 270, '', '鄒松佑', '陳進中', '黑光樂團', '', '', 0, 0, 1, '2010-09-09 00:13:56', '2013-10-07 17:16:58', '0000-00-00 00:00:00'),
(27634, 83259, 0, 1, '跑', '希望在人生的道路上 大家能夠完成自己的目標與夢想', '2010-09-09 00:00:00', 2010, 0, 1, 1, '跑 漫無目的的跑\r\n只因為還沒找到屬於我的地方\r\n夢 就在那不遠方向\r\n放開手 不後悔\r\nI Wanna Say I''m Not OKAY\r\n去感覺這一切所謂的無奈和疲憊\r\n在這世界 沒有絕對\r\n不怕累\r\n找到夢想就不要輕易地後退\r\n\r\n跑 漫無目的的跑\r\n只因為還沒找到屬於我的地方\r\n夢 就在那不遠方向\r\n張開手 就能飛\r\nI Wanna Say I''m Not OKAY\r\n去感覺這一切所謂的無奈和疲憊\r\nJust Wanna Say I''m not afaird\r\nTO the Sky\r\n找到夢想就不要輕易地後退\r\n\r\n我以為這就是我\r\n從沒想過如果一切能從頭\r\n我們不應該是\r\n從一開始\r\n就對自己設下太多限制\r\n\r\n當你說放棄的時候\r\n有沒有有想過\r\n是否到此了為止\r\n就算世界與我為敵\r\n太多沉迷\r\n讓我們超越自己筆直的前進', '', 196, '', '羅鑫耀', '羅鑫耀', '羅鑫耀', '', '', 0, 0, 1, '2010-09-09 00:27:39', '2013-10-07 17:16:58', '0000-00-00 00:00:00'),
(27635, 83259, 0, 1, '我是誰', '跟我最親近的人莫過於自己\r\n但是有的時候..... \r\n最不認識自己的人 \r\n也許是我自己', '2010-09-09 00:00:00', 2010, 0, 1, 1, '叫醒我\r\n讓我不要在這樣胡鬧的世界\r\n隨波逐流\r\n浮浮沉沉\r\n在我沒把握不會溺斃的時候\r\n別讓我墜落\r\n張開雙手不夠\r\n鬆綁了我的手\r\n走到十字路口\r\n別叫我再回頭\r\nHEY 我是誰\r\n不要把我留在這畫面\r\n找不到出口那天\r\n原來猙獰的是我的臉', '', 188, '', '羅鑫耀', '羅鑫耀', '羅鑫耀', '', '', 0, 0, 1, '2010-09-09 00:28:29', '2013-10-07 17:16:58', '0000-00-00 00:00:00'),
