(27708, 83728, 0, 9, '痕心', '', '2010-09-14 00:00:00', 2000, 8, 0, 1, '沉默的日記 刻畫心的傷痕\r\n越來越沉默的我們\r\n也只剩空洞的靈魂\r\n從你不誠懇的眼神\r\n透露了我們不可能\r\n凍結的靈魂 已不能親吻\r\n你只是害怕承認 怕會傷的太深\r\n所以才逃避遺忘了為愛犧牲\r\n你只是害怕承認 怕會傷的太深\r\n你用不在乎的眼神 \r\n徹底傷透了 我的靈魂 \r\n\r\n你虛偽的誠懇 信任無法延伸 \r\n為愛烙上紋身 是我想焚滅的灰塵\r\n我看清了愛已擱淺 不再淪陷 \r\n你繼續放縱去欺騙 你的雙眼 \r\n不想再做 你的魁儡', '', 189, '', 'PRIDE 229', 'PRIDE 229', 'PRIDE 229', '', '', 0, 0, 1, '2010-09-14 03:34:17', '2013-10-07 17:16:59', '0000-00-00 00:00:00'),
(27709, 58920, 2753, 1, '種佇心內的紀念碑 (紀念鄭南榕之歌)', '再拒劇團2010秋　煽動新作\r\n\r\n年輕記者在報館離奇身故，但沒有人知道為什麼，還是該問，有人需要在乎嗎？既然如此，多年前那場將雜誌社化為灰燼的大火，是否連同它的時代意義一起被新世代的冷笑話封印在水底墓穴中的妖獸體內？原來我們的敵人從來就不那麼簡單 ──\r\n\r\n從《自由時代週刊》到「自由時代」，我們還有什麼？\r\n\r\n「我並不同意你的觀點，但是我誓死捍衛你說話的權利。」\r\n\r\n導演 黃緣文\r\n演員 王安琪 王博玄 陳家祥 楊景翔 趙逸嵐\r\n編劇 高俊耀 簡莉穎 黃緣文\r\n製作群 藍貝芝 陳憶玲 劉語柔\r\n舞台監督 林岱蓉\r\n舞台設計 陳成婷 吳修和\r\n燈光設計 劉柏欣\r\n音樂設計 馮皓\r\n造型設計 朱怡靜\r\n平面設計 陳世川\r\n攝影 陳又維\r\n贊助單位： 國家文化藝術基金會 台北市文化局\r\n協力單位： 牯嶺街小劇場 誠品站 直走咖啡 小地方SEAMS\r\n', '2010-09-14 00:00:00', 2000, 0, 2, 6, '佇暗暝的天頂\r\n寫一首安魂曲\r\n為死去的你的肉體\r\n為活咧的你的精神\r\n\r\n佇日時的天頂\r\n畫一幅殉難圖\r\n為遠去的你的形影\r\n照出燦爛的光彩\r\n\r\n孤單佇在嚎\r\n自由的聲音 \r\n是一隻火鳥 \r\n飛出咱自由的翅 \r\n\r\n佇大地的清泉\r\n阮走找你的腳印\r\n發現你冷靜的備忘錄\r\n照著歷史\r\n自由的圖\r\n', '', 135, '', 'VOICE(馮皓)', '李敏勇', 'VOICE(馮皓)', '再拒劇團', '', 0, 1, 0, '2010-09-14 05:09:34', '2015-03-12 13:43:37', '0000-00-00 00:00:00'),
(27710, 83728, 0, 1, '空白的直覺', '', '2010-09-14 00:00:00', 2000, 6, 0, 1, '如果當初是因錯誤而相遇\r\n那至少現在有了對的決定\r\n我以為可以習慣沒有妳 \r\n但寂寞所夾雜的全是哭泣\r\n\r\n原以為少了呼吸 但至少還能擁有妳 \r\n不敢去猜妳內心裡的我 會有多 空白\r\n或許妳沒有 當初奮不顧身 的愛我一切\r\n為何這思念 在對我 說抱歉\r\n（不想在聽見 妳對我說抱歉）\r\n想要收回的愛 卻一直都在 徘徊在妳劃下的等待\r\n想要給妳的愛 卻被妳擋在 妳心裡要的另一個依賴\r\n也只能習慣 妳給的答案\r\n\r\n也許習慣孤獨 才能夠給妳祝福\r\n熟悉了 不哭 在讓愛 落幕 \r\n最後選擇退出 並不代表我 不在乎', '', 298, '', 'PRIDE 229', 'PRIDE 229', 'PRIDE 229', '', '', 0, 1, 0, '2010-09-14 06:32:44', '2015-03-12 13:43:37', '0000-00-00 00:00:00'),
